import React from "react";

import {MProps} from "./interfaces";

export const Toggler = (props: MProps) => {
  const toggle = () => {
    if (props.toggleHandler) props.toggleHandler();
  };
  return (
      <div className="uda-nistapp-logo uda_exclude" onClick={() => toggle()} style={{ display: !props?.toggleFlag ? "none" : "block" }}>
        <div className="uda-icon uda_exclude">
          <img className="uda_exclude"
              src="data:image/png;base64,"/>
          <p className="uda-icon-title uda_exclude">
            UDAN(Beta)
          </p>
          <span>
    		    <img className="uda_exclude"
             src="data:image/png;base64,"/>
  		    </span>
        </div>
      </div>
  );


};

/**
 *
 * @returns logo path
 */
export const getLogo = () => {
  return "https://cdn.statically.io/gh/Digital-Assistant/Digital_Assistant_Client/react-typescript/udan-react-ts/src/logo.svg";
};
